import React, { Component } from 'react';
import PropTypes from 'prop-types';
import ProjectDetailsModal from './ProjectDetailsModal';
import Form from 'react-bootstrap/Form';
import Stack from 'react-bootstrap/Stack';
import Col from 'react-bootstrap/Col';
import InputGroup from 'react-bootstrap/InputGroup';

class Projects2 extends Component {
  static propTypes = {
    resumeProjects: PropTypes.array.isRequired,
    resumeBasicInfo: PropTypes.object.isRequired,
  };

  state = {
    deps: {},
    detailsModalShow: false,
    filteredProjects: [],
    searchInput: '',
    value: 'All',
  };

  detailsModalShow = (data) => {
    this.setState({ detailsModalShow: true, deps: data });
  };

  detailsModalClose = () => {
    this.setState({ detailsModalShow: false });
  };

  filterProjects = (query) => {
    const filtered = this.props.resumeProjects.filter((project) =>
      project.title.toLowerCase().includes(query.toLowerCase())
    );
    this.setState({ filteredProjects: filtered });
  };

  handleChange = (e) => {
    this.setState({ searchInput: e.target.value });
  };

  handleSelectChange = (e) => {
    const value = e.target.value;
    this.setState({ value });
  };

  render() {
    const { resumeProjects, resumeBasicInfo } = this.props;
    const { filteredProjects, searchInput, value } = this.state;

    let projects = [];

    if (resumeProjects && resumeBasicInfo) {
      const sectionName = resumeBasicInfo.section_name.projects;
      projects = filteredProjects.length ? filteredProjects : resumeProjects;

      projects = projects.map(function (project) {
        return (
          <div
            className="col-sm-12 col-md-6 col-lg-4"
            key={project.title}
            style={{ cursor: 'pointer' }}
          >
            <span className="portfolio-item d-block">
              <div className="foto" onClick={() => this.detailsModalShow(project)}>
                <div>
                  <img
                    src={project.images[0]}
                    alt="projectImages"
                    height="230"
                    width="368"
                    style={{ marginBottom: 0, paddingBottom: 0, position: 'relative' }}
                  />
                  <span className="project-date">{project.startDate}</span>
                  <br />
                  <p className="project-title-settings mt-3">{project.title}</p>
                </div>
              </div>
            </span>
          </div>
        );
      }, this);
    }

    return (
      <div>
        <Stack>
          <React.Fragment>
            <div className="project-choices">
              {filteredProjects.map((project) => (
                <Col key={project.title}>
                  <Projects2 resumeProjects={[project]} />
                </Col>
              ))}
            </div>
            <InputGroup>
              <Form.Control
                type="search"
                onChange={this.handleChange}
                placeholder="Search"
                aria-label="Search"
                aria-describedby="basic-addon1"
                value={searchInput}
              />
              <InputGroup.Text id="basic-addon1">Filter by:</InputGroup.Text>
              <Form.Control as="select" onChange={this.handleSelectChange} value={value}>
                <option value="All">All</option>
                <option value="name">Name</option>
                <option value="popularity">Popularity</option>
                <option value="recent">Recent</option>
                <option value="size">Size</option>
              </Form.Control>
            </InputGroup>
          </React.Fragment>
        </Stack>
        <div className="background">
          <div className="transparentbox">
            <section id="portfolio">
              <div className="col-md-12">
                <h1 className="section-title" style={{ color: 'black' }}>
                  <span>{sectionName}</span>
                </h1>
                <div className="col-md-12 mx-auto">
                  <div className="row mx-auto">{projects.length && <div>{projects}</div>}</div>
                </div>
                <ProjectDetailsModal
                  show={this.state.detailsModalShow}
                  onHide={this.detailsModalClose}
                  data={this.state.deps}
                />
              </div>
            </section>
          </div>
        </div>
      </div>
    );
  }
}

export default Projects2;
